        private static int GetSwapCount(int[] a)
        {
            Dictionary<int, int> map = new Dictionary<int, int>(a.Length);
            for (int i = 0; i < a.Length; i++)
            {
                map[a[i]] = i;
            }

            var sorted = a.ToList().OrderBy(value => value).ToList();

            int swapCount = 0;
            for (int i = 0; i < a.Length; i++)
            {
                if (a[i] > sorted[i])
                {
                    swapCount++;

                    int swapIndex = map[sorted[i]];
                    map[a[i]] = swapIndex;
                    map[sorted[i]] = i;

                    Swap(a, i, swapIndex);
                }
            }

            return swapCount;
        }

        private static int GetMinimumSwapCountToSort(int[] a)
        {
            var sortedAsc = ((int[]) a.Clone()).ToList();
            sortedAsc.Sort();

            int swapCount = 0;
            for (int i = 0; i < a.Length; i++)
            {
                int sortedLowest = sortedAsc[i];
                int currentValue = a[i];

                if (currentValue > sortedLowest)
                {
                    int currentLowestValueIndex = Array.IndexOf(a, sortedLowest);
                    //Console.WriteLine("[{0:0000}] Swapping {1} <=> {2}", swapCount, a[i], a[currentLowestValueIndex]);
                    Swap(a, i, currentLowestValueIndex);

                    swapCount++;
                }
            }

            return swapCount;
        }

        private static void Swap(int[] a, int i1, int i2)
        {
            var temp = a[i1];
            a[i1] = a[i2];
            a[i2] = temp;
        }
